import React from "react";


const Form = () => {
  //Aqui deberan implementar el form completo con sus validaciones

  return (
    <div>
      <form>
        <label htmlFor="name">Name</label>
        <input type="text" name="name"/>
        <label htmlFor="email">E-mail</label>
        <input type="email" name="email"/>
      </form>
    </div>
  );
};

export default Form;
